import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './entur_logo.jpg';

class NavBar extends React.Component {

    render() {
        return (
            <div className="navBar">
                <div className="logo">
                    <img src={logo} width={500} height={300} />
                </div>
            </div>
        )
    }

}

class Register_box extends React.Component {

    render() {
        return (
            <form>
                <h3 className="text-center text-white">Registrer ny melding</h3>
                <br></br>
                <div className="form-row d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="fromDate p-2 flex-grow-1">
                        <p className="text-center text-white">Fra</p>
                        <input type="date" className="form-control" placeholder="Fra dato"/>
                    </div>
                    <div className="toDate p-2 flex-grow-1">
                        <p className="text-center text-white">Til</p>
                        <input type="date" className="form-control" placeholder="Til dato"/>
                    </div>
                </div>
                <div className="message">
                    <p className="text-center text-white">Melding</p>
                    <input type="String" className="form-control" placeholder="Melding"/>
                </div>
                <br></br>
                <br></br>
                <div className="valid_for btn-group btn-group-toggle d-flex flex-row bd-highlight mb-3 justify-content-center" data-toggle="buttons">
                    <label className="btn btn-outline-light p-3 active">
                        <input type="radio" name="options" id="option1" autoComplete="off"/> Linje
                    </label>
                    <label className="btn btn-outline-light p-3">
                        <input type="radio" name="options" id="option2" autoComplete="off"/> Stopp
                    </label>
                    <label className="btn btn-outline-light p-3">
                        <input type="radio" name="options" id="option3" autoComplete="off"/> Avgang
                    </label>
                </div>
                <div className="search">
                    <input type="String" className="form-control" placeholder="SÃ¸k"/>
                </div>
                <br></br>
                <br></br>
                <div className="sumbit">
                    <button type="submit" className="btn btn-primary btn-lg btn-block">Submit</button>
                </div>
            </form>

        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <Register_box />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
